import MiddleNav from './MiddleNav';
import MainNav from './MainNav';
import Container from 'react-bootstrap/Container';

function Nav() {
  return (
    <header>
      <Container
        fluid
        style={{ padding: '0' }}
      >
        <MainNav />
        <div
          style={{
            backgroundColor: '#009688',
            paddingTop: '6rem',
            paddingBottom: '8rem'
          }}
        >
        </div>
        <MiddleNav />
      </Container>
    </header>
  );
}

export default Nav;
